import React from 'react';
import './App.css';
import Submit from './components/submit';
import Video from './components/video';

function App() {
  return (
    <div className="App">
      <div>
        请选择要上传的视频文件 
      </div>
      <div>
        <Submit/>
      </div>
      <div>
        ---------------------------------------------------
      </div>
      <div>
        <Video fdir="./2.mp4" fid="fileinput"/>
      </div>
    </div>
  );
}

export default App;
